import React from 'react';
import './App.css';
import Contador from './Contador'
import LabelCronometro from './LabelCronometro'
import {Navbar, Nav} from 'react-bootstrap';
import logo from './logo.png';



function App_cronometro() {
  return (
    <div>
    <Navbar bg="primary" variant="dark">
    <Navbar.Brand href="#home">Rel贸gio Online</Navbar.Brand>
    <Nav className="mr-auto">
		<Nav.Link href="/">Rel贸gio</Nav.Link>
		<Nav.Link href="/cronometro">Cron么metro</Nav.Link>
		<Nav.Link href="/timer">Temporizador</Nav.Link>
    </Nav>
</Navbar>
	<div class="menor inline"><img src={logo} className="App-logo" alt="logo" /></div>
		<div class='container'>
			<div class="justify-content-center d-flex">
				<LabelCronometro class="display-2 dark titulo"name="Cron么metro"/>
			</div>
			<div class="justify-content-center d-flex">
				<Contador/>
			</div>
		</div>
    </div>
  );
}

export default App_cronometro;
